import React from "react";
const TodoDetails =({workout})=>{
return(
    <div className="workout-details">
        <h4>{workout.title}</h4>
        <p><strong>Load:</strong>{workout.load}kg </p>
        <p><strong>Load:</strong>{workout.reps}kg </p>
    </div>
)

}
